import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Article from "./containers/Article";
import ArticleListing from "./containers/ArticleListing";
import "./App.css";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/article">
          <Article />
        </Route>
        <Route path="/">
          <ArticleListing />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
